import React from 'react';

function Header() {
  return (
    <header style={{
      backgroundColor: '#333',
      color: 'white',
      padding: '1rem',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center'
    }}>
      <h1>Shop Online</h1>
      <nav>
        <ul style={{
          display: 'flex',
          listStyle: 'none',
          gap: '20px',
          margin: 0,
          padding: 0
        }}>
          <li><a href="/" style={{ color: 'white', textDecoration: 'none' }}>Trang chủ</a></li>
          <li><a href="/products" style={{ color: 'white', textDecoration: 'none' }}>Sản phẩm</a></li>
          <li><a href="/cart" style={{ color: 'white', textDecoration: 'none' }}>Giỏ hàng (0)</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
